  let texCoord = 
    i32(block_id.x * MaxFilterSize + thread_id) * filterDirection + 
    i32(block_id.y) * (vec2<i32>(1) - filterDirection);
  sharedBuffer[thread_id] = textureLoad(srcTexture, texCoord - i32(HalfMaxFilterSize) * filterDirection, 0).r;
